import * as React from 'react';
import { NavBarHeader } from './NavBarHeader'
import { NavBarList } from './NavBarList'

interface Props {
}

const myStyle = {
    borderRight: '1px solid #5e5e5e',
    height: '100vh',
    width: '250px',
    position: 'fixed'
}

export const NavBarContainer: React.FC<Props> = () => {
    return ( 
        <div style={myStyle} className='navBarContainer'>
            <NavBarHeader title='coinbase'/>
            <NavBarList />
        </div>
     );
}
